import Card from 'react-bootstrap/Card';

const RecipeItem = (props) => {
    if(props.quick_and_easy === true){
        const quick_and_easy = 'true';
    }
    else{
        const quick_and_easy = 'false';
    }

    return (
        <Card>
            <Card.Header>
                {props.title}
            </Card.Header>
            <Card.Body>
                <h2>{props.image}</h2>
                <h6>{props.meat}</h6>
                <h6>{props.category}</h6>
                <h6>{props.rating}</h6>
                <h6>{quick_and_easy}</h6>
                <h6>{props.is_favorite}</h6>
                <h6>{props.have_made_before}</h6>
            </Card.Body>
        </Card>
    )
}

export default RecipeItem;
